(1005, 'MS-1005', 'GRETER', 'MATIKO', 21.597, 'female', 1026334800, '0719971192', 1708076520, 6, 7, 'tested', '[{\"testTypeName\":\"Pelvic Ultrasound\",\"testTypeId\":\"msua-test-lsnk9pjm\",\"testResults\":\"Gravid uterus with a single gestational sac containing a double echogenic rim in the upper uterine segment seen.\\nFetal pole seen .\\nCardiac activities are positive.\\nNo any adnexal pathology noted.\\nIntact internal OS seen.\\nCul de sac is clear.\\nFETAL BIOMETRY\\nCRL measures16.5mm corresponding to 6 weeks and 5 days GA\\nEstimated date of delivery(EDD)=06/10/2024\",\"testRemarks\":\"EARLY IUPT AT 6 WEEKS AND 5 DAYS  GA.\\nNORMAL FETAL SURVEY\\nRESCAN AFTER 3 MONTHS.\"}]', 'no', NULL, '2024-02-16 09:46:16'),
(1006, 'MS-1006', 'BEATRICE', 'MABINA', 26.4468, 'female', 873493200, '0652447691', 1708168020, 6, 7, 'tested', '[{\"testTypeName\":\"Pelvic Ultrasound\",\"testTypeId\":\"msua-test-lsnk9pjm\",\"testResults\":\"ABDOMINAL AND PELVIC ULTRASOUND REPORT\\n\\nClinical information:\\n\\nFindings:\\nLiver:  Normal in size with homogeneous parenchymal echogenicity. No focal nodule or diffuse lesion seen. No intrahepatic or extrahepatic biliary dilatation. Common bile duct . Portal and hepatic veins appear normal in caliber and flow.\\nGall bladder:  Physiologically distended. No abnormal intraluminal echoes. Wall thickness is normal. No evidence of sludge, stones or polyps.  No pericholecystic collection seen.\\nPancreas: Normal in size with homogeneous parenchymal echogenicity.  No focal mass or diffuse lesion seen. No evidence of ductal dilatation or calcification seen.\\nSpleen: Normal in size with homogeneous parenchymal echogenicity. No focal nodule or diffuse lesion seen. Splenic vein is normal.\\nKidneys: Both are normal in size, outline and echogenicity. Corticomedullary differentiation   is maintained. No evidence of mass lesion or calculus seen. No evidence of pelvicalyectasis seen.\\nRetroperitoneum:  Abdominal aorta is of normal caliber. No evidence of para-aortic lymphadenopathy seen.\\nPeritoneum: No evidence of ascites seen.\\nBowels: No evidence of bowel dilation seen. Peristalsis appears normal. \\nBladder:  Adequately distended. Wall thickness is normal. No evidence of mass or calculi seen. No intraluminal echoes seen. Bilateral ureterovesical junctions are patent. Pre-micturition \\nUterus: Anteverted, normal in size and shape having normal homogeneous myometrial echoes Ovaries and adnexae: No ovarian or adnexal mass lesion. No free fluid in the Pouch of Douglas.\\n\\nImpression:\\nNormal abdominal and pelvic sonography.\\n\\n\",\"testRemarks\":\"ABDOMINAL AND PELVIC ULTRASOUND REPORT\\n\\nClinical information:\\n\\n\\nImpression:\\nNormal abdominal and pelvic sonography.\\n\\n\"}]', 'no', NULL, '2024-02-17 11:09:15'),
