(1015, 'MS-1015', 'REBECA', 'ISSA', 20.1381, 'female', 1072904400, '0789926690', 1708548000, 6, 7, 'tested', '[{\"testTypeName\":\"Ostetric Ultrasound\",\"testTypeId\":\"msua-test-lsu4xoua\",\"testResults\":\"OBSTETRIC US REPORT\\nFindings:\\nA single fetus is noted having cephalic presentation.\\nHC corresponds to 34 weeks 2 days.\\nAC corresponds to 36 weeks 4 days.\\nFL corresponds to 35 weeks 1 days.\\nAverage age by US =34  weeks 5 days.\\nAge by LMP =  36 weeks 00 days.\\nPresent estimated fetal weight is 2617gms.\\nFetal heart rate is 151bpm and regular. Four chamber view of heart was satisfactory.\\nMorphologically the fetus appears grossly normal and fetal movements are seen.\\nLiquor is adequate.\\nPlacenta is posterior and not low lying.\\nUmbilical cord is not looped around the neck.\\nUmbilical arterial Doppler flows are within normal limits. \\nCervical length measures 3.6cm. Internal Os is closed. No funneling seen.\\n\\n\\n\\n\\n\",\"testRemarks\":\">A SINGLE VIABLE IUPT AT 34 WEEKS AND 5 DAYS GA WITH CEPHALIC PRESENTATION.\\n>NORMAL FETAL SURVEY.\"}]', 'yes', 'MS-1013', '2024-02-21 11:57:18'),
