(1111, 'MS-1111', 'MARRY', 'MREMA METHOD', 33.8498, 'female', 643582800, '0767653641', 1712074920, 6, 7, 'tested', '[{\"testTypeName\":\"Abdominal Pelvic USS\",\"testTypeId\":\"msua-test-lsnk9pjm\",\"testResults\":\"ABDOMINAL AND PELVIC ULTRASOUND REPORT\\nClinical information:pv bleeding\\nFindings:\\nLiver:  Normal in size with homogeneous parenchymal echogenicity. No focal nodule or diffuse lesion seen. No intrahepatic or extrahepatic biliary dilatation. Portal and hepatic veins appear normal in caliber and flow.\\nGall bladder:  Physiologically distended. No abnormal intraluminal echoes. Wall thickness is normal. No evidence of sludge, stones or polyps.  No pericholecystic collection seen.\\nPancreas: Normal in size with homogeneous parenchymal echogenicity.  No focal mass or diffuse lesion seen. No evidence of ductal dilatation or calcification seen.\\nSpleen: Normal in size with homogeneous parenchymal echogenicity. No focal nodule or diffuse lesion seen. Splenic vein is normal.\\nKidneys: Both are normal in size, outline and echogenicity. Corticomedullary differentiation   is maintained. No evidence of mass lesion or calculus seen. No evidence of pelvicalyectasis seen.\\nRetroperitoneum:  Abdominal aorta is of normal caliber. No evidence of para-aortic lymphadenopathy seen.\\nPeritoneum: No evidence of ascites seen.\\nBowels: No evidence of bowel dilation seen. Peristalsis appears normal. \\nBladder:  Adequately distended. Wall thickness is normal. No evidence of mass or calculi seen. No intraluminal echoes seen. Bilateral ureterovesical junctions are patent. Pre-micturition \\nUterus: Anteverted, normal in size and shape having normal homogeneous myometrial echoes Ovaries and adnexae: No ovarian mass or lession seen. \\nFree fluid in the Pouch of Douglas.\\n\\n\\n\\n\",\"testRemarks\":\"Findings are indicative of a complete abortion.\"}]', 'no', NULL, '2024-04-02 16:23:55'),
(1112, 'MS-1112', 'MATHIAS  ', 'MARATO   WEREMA', 74.2527, 'male', -631161900, '0762771436', 1712135580, 6, 7, 'tested', '[{\"testTypeName\":\"Abdominal Pelvic USS\",\"testTypeId\":\"msua-test-lsnk9pjm\",\"testResults\":\"ABDOMINAL AND PELVIC ULTRASOUND REPORT\\nClinical information:Bilateral frank pain,lower abdominal pain, epigastric pain,lower urinary tack symptoms(LUTS)\\nFindings:\\nLiver:  Normal in size with homogeneous parenchymal echogenicity. No focal nodule or diffuse lesion seen. No intrahepatic or extrahepatic biliary dilatation. Portal and hepatic veins appear normal in caliber and flow.\\nGall bladder:  Physiologically distended. No abnormal intraluminal echoes. Wall thickness is normal. No evidence of sludge, stones or polyps.  No pericholecystic collection seen.\\nPancreas: Normal in size with homogeneous parenchymal echogenicity.  No focal mass or diffuse lesion seen\\nSpleen: Normal in size with homogeneous parenchymal echogenicity. No focal nodule or diffuse lesion seen. Splenic vein is normal.\\nKidneys: Both are normal in size, seen with an anechoic bear paw, with the dilated calyces representing finger-like projections . No evidence of mass lesion or calculus seen on the right kidney while a roundish aneichoic structure seen. on the left kidney measuring 4.1cm by 5.3cm .\\nPeritoneum: No evidence of ascites seen.\\nBowels: No evidence of bowel dilation seen. Peristalsis appears normal. \\nBladder:  Adequately distended with abnormal wall thickness measuring 0.56cm. No evidence of mass or calculi seen. No intraluminal echoes seen. Bilateral ureterovesical junctions are patent.\\nProstate: Appears enlarged in size and echogenicity. Measures 42.64gms. No evidence of calcifications or nodularity.\\n\\n\\n\",\"testRemarks\":\"Findings are indicative of bilateral mild hydronephrosis ,left renal cyst measuring 4.1cm by 5.3cm as well as acute cystitis and benign prostatic hyperplasia(bhp)\"}]', 'no', NULL, '2024-04-03 09:18:09'),
(1113, 'MS-1113', 'ANGEL', 'SAGAJA  MASATU', 21.4797, 'female', 1034197200, '0688946089', 1712140980, 6, 7, 'tested', '[{\"testTypeName\":\"Obstetric USS\",\"testTypeId\":\"msua-test-lsu4xoua\",\"testResults\":\"OBSTETRIC ULTRASOUND REPORT. \\nClinical Information:CLINIC\\nFindings:\\nSingle intra-uterine fetus  seen at GA of 31 weeks and 5 days GA with BREACH presentation lying longitudinally in maternal RIGHT side.\\nFetal movements and cardiac activities are positive. FHR=150Bpm.\\nFetal anatomy including skull bones, brain tissues, spine , stomach , 4 chambered of the heart are normal. No any abnormality seen.\\nPlacenta location is fundal anterior and not low lying.\\nAmniotic fluid is adequate.\\nInternal os is closed.\\n           FETAL BIOMETRY;\\nBPD= 80.1mm corresponding s to 32weeks 2 days.\\nAC= 260.1mm Corresponding s to 30weeks ..1 days.\\nHC= 300mm Corresponding s to 32weeks6days.\\nFL=.59.7mm Corresponding s to  31weeks 4 days.\\nEFW=1712.6g         EDD=31/05/2024\\n\\n\\n\\n\",\"testRemarks\":\">SINGLE INTRA-UTERINE FETUS AT GA OF 31WEEKS 5 DAYS BREACH PRESENTATION.\\n>NORMAL FETAL SURVEY. \\n\"}]', 'no', NULL, '2024-04-03 10:44:33'),
(1114, 'MS-1114', 'IKORE', 'ROBIRI   IKORE', 62.5712, 'male', -262494000, '0766279524', 1712154660, 6, 7, 'tested', '[{\"testTypeName\":\"Abdominal Pelvic USS\",\"testTypeId\":\"msua-test-lsnk9pjm\",\"testResults\":\"Kidneys:\\nRt kidney measures 9cm x 4.4 cm. Lt kidney measures 8.7cm x 3.9 cm.\\nRenal parenchymal has homogeneous echogenicity bilaterally.\\nCortical outline appears smooth with clear cortico medullary differentiation.\\nNormal pelvi-calyceal systems seen bilaterally. No evidence of hydronephrosis or calculi seen.\\nUreters:\\nNo evidence of proximal or distal hydroureter seen bilaterally. Bilateral ureterovesical junctions are patent. No evidence  or calculi seen.\\nBladder:\\nAdequately distended and appears normal in shape. No evidence of abnormal wall thickening noted.\\nNo abnormal intraluminal echoes, stones or masses seen.\\nProstate: \\nNormal in size, measuring 18.9 gms. Normal echopattern  noted within the gland. No evidence of calcification\\n\\t\\t\\t\\t\\t\\t\\t\\t\\t\\t\\n\",\"testRemarks\":\"NORMAL UROLOGICAL ULTRASOUND\"}]', 'no', NULL, '2024-04-03 14:33:48');
